  const Button = ({icon, href, text})=>{
    return <Link target='_blank' className="link" href={href}>
              {icon}{text}
          </Link>
  }

  const ButtonMore = ({icon, href, text})=>{
    return <Link target='_blank' className="link more" href={href}>
              {icon}{text}
          </Link>
  }

  const randomButtons = [
      <Button
        icon={icons['gamepad-grey']}
        text='Processos seletivos'
        href='https://chavemestra.net/gamificacao?origin=bio-insta'
      />,

      <Button
        icon={icons['clan-blue']}
        text='Treinamentos'
        href='https://chavemestra.net/gamificacao?origin=bio-insta'
      />,

      <Button
        icon={icons['chest-magic']}
        text='Onboarding'
        href='https://chavemestra.net/gamificacao?origin=bio-insta'
      />,
  ]

  //needs to update the get the random numbers for the indexes
  function getTwoDistinctItems(list) {
    if (list.length < 2) {
      console.log('The list must contain at least two distinct items.')
    }
  
    const [firstItem, ...restOfList] = list
    const secondItem = restOfList.find((item) => item !== firstItem)
  
    if (secondItem === undefined) {
      console.log('All items in the list are the same.')
    }
  
    return [firstItem, secondItem]
  }

  const Solutions = ()=>{
    const [item1, item2] = getTwoDistinctItems(randomButtons)
    return <>{item1}{item2}</>
  }

